import React, { useState } from "react";
import ArticleOutlinedIcon from "@mui/icons-material/ArticleOutlined";
import InsertPhotoOutlinedIcon from "@mui/icons-material/InsertPhotoOutlined";
import PlaceOutlinedIcon from "@mui/icons-material/PlaceOutlined";
import SortOutlinedIcon from "@mui/icons-material/SortOutlined";
import EventNoteOutlinedIcon from "@mui/icons-material/EventNoteOutlined";
import "./icons.css";
import { IconButton, Popover, Typography } from "@mui/material";
const IconSection = () => {
  const [anchorEl, setAnchorEl] = useState(null);

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  const open = Boolean(anchorEl);
  const id = open ? "simple-popover" : undefined;
  const sortingData = [
    { sortBy: "durations", sortorder: "asc", label: "Durations ASC" },
    { sortBy: "durations", sortorder: "desc", label: "Durations DESC" },
    { sortBy: "price", sortorder: "asc", label: "Price ASC" },
    { sortBy: "price", sortorder: "desc", label: "Price DESC" },
  ];
  return (
    <div className="icons-container">
      <div
        style={{
          display: "flex",
          flexDirection: "row",
          justifyContent: "flex-start",
          alignContent: "flex-start",
          gap: 15,
        }}
      >
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            flexDirection: "column",
          }}
        >
          <ArticleOutlinedIcon
            style={{
              color: "#E0A64E",
              height: 36,
              width: 36,
              alignItems: "center",
              alignContent: "center",
            }}
          />
          <Typography sx={{ fontSize: 10, color: "#8D4337" }}>
            Contact
          </Typography>
        </div>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            flexDirection: "column",
          }}
        >
          <InsertPhotoOutlinedIcon
            style={{
              color: "#716966",
              height: 36,
              width: 36,
              alignItems: "center",
              alignContent: "center",
            }}
          />
          <Typography sx={{ fontSize: 10, color: "#716966" }}>
            Gallary
          </Typography>
        </div>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            flexDirection: "column",
          }}
        >
          <PlaceOutlinedIcon
            style={{
              color: "#716966",
              height: 36,
              width: 36,
              alignItems: "center",
              alignContent: "center",
            }}
          />
          <Typography sx={{ fontSize: 10, color: "#716966" }}>
            Location
          </Typography>
        </div>
      </div>

      <div
        style={{
          display: "flex",
          flexDirection: "row",
          justifyContent: "space-between",
          gap: 15,
        }}
      >
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            flexDirection: "column",
          }}
        >
          <EventNoteOutlinedIcon
            style={{
              color: "#716966",
              height: 36,
              width: 36,
              alignItems: "center",
              alignContent: "center",
            }}
          />
          <Typography sx={{ fontSize: 10, color: "#716966" }}>
            Shortlisted
          </Typography>
        </div>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            flexDirection: "column",
          }}
        >
          <IconButton onClick={handleClick}>
            <SortOutlinedIcon
              style={{
                color: "#716966",
                height: 36,
                width: 36,
                alignItems: "center",
                alignContent: "center",
              }}
            />
          </IconButton>
          <Typography sx={{ fontSize: 10, color: "#716966" }}>Short</Typography>
          <Popover
            id={id}
            open={open}
            anchorEl={anchorEl}
            onClose={handleClose}
            anchorOrigin={{
              vertical: "bottom",
              horizontal: "left",
            }}
          >
            {sortingData.map((sortingData) => (
              <Typography sx={{ 1: 2 }}>{sortingData.label}</Typography>
            ))}
          </Popover>
        </div>
      </div>
    </div>
  );
};

export default IconSection;
